    private String getUrl(
            String ip,
            String url,
            Boolean scrollToBottom,
            String chromeArg,
            String hoverElement,
            String xpathExpr,
            String waitForElement,
            Integer wait,
            String endpoint
    ) {
        chromeArg = chromeArg == null ? "" : "&chromeArg=" + fileHelper.base64Encode(chromeArg);
        hoverElement = hoverElement == null ? "" : "&hoverElement=" + fileHelper.base64UrlEncode("div[class*='gallery-pro-name'] > a");
        xpathExpr = xpathExpr == null ? "" : "&multipleClick=" + fileHelper.base64Encode("*:contains('Alle Cookies erlauben')");
        waitForElement = waitForElement == null ? "" : "&waitForElement=" + fileHelper.base64Encode("div[class*='gallery-pro-name'] > a");

        return "http://" + ip + ":8081" + "/api/v1/" + endpoint + "?url=" + fileHelper.base64UrlEncode(url)
                + (scrollToBottom ? "&scrollToBottom=true" : "&scrollToBottom=false")
                + chromeArg
                + hoverElement
                + xpathExpr
                + waitForElement
                + "&wait=" + (wait != null ? wait : "8000");
    }

